import Head from 'next/head'
import Navbar from '../components/Navbar'
import Subscription from '../components/Subscription'
import {table,minifyRecords} from './api/utils/Airtable'
export default function Home({initialSubs}) {
  console.log(initialSubs)
  return (
    <div >
      <Head>
        <title>Subscriptions Tracker App</title>

      </Head>
      <Navbar />

      <main >
        <h1>Subscriptions Tracker</h1>
        <br/>
        <ul>
        {initialSubs.map(subscription=><Subscription key={subscription.id} subscription={subscription} />)}
        </ul>

      </main>


    </div>
  )
}

export async function getServerSideProps(context){
  try {
    const subs=await table.select({}).firstPage()
  return {
    props:{
      initialSubs:minifyRecords(subs)
    }
  }

  } catch (error) {
    console.error(err)
    return {
      props:{
        err:"AHHH WTF!!!"
      }
    }

  }


}
